// import '../styles.css'

const Index = () => {
    return (
        <div>
            <h1>VKYD</h1>
            <h3>Pseduo-CDN built on Next.JS with Vercel</h3>
            <style jsx>{`
                @font-face {
                    font-family: Plateia;
                    src: url(public/fonts/Plateia-Bold.ttf);
                }

                h1 {
                    font-family: Plateia;
                }
            `}</style>
        </div>
    )
};

export default Index;
